import { Login } from '../views';
import Beranda from '../views/beranda/beranda';
import Absensi from '../views/absensi/absensi';

export const MainRoutes = [
    {
        path: '/',
        component: Login
    },
    {
        path: '/home',
        component: Beranda
    },
    {
        path: '/absensi',
        component: Absensi
    }
];
